import React, { Component } from "react";
import Questions from '../Questions/Questions'
import Procedure from '../Procedure/Procedure'
import './Home.css';

class Home extends Component {

  constructor(props) {
    super(props);
    this.state = {
      modalState: true
    };
    this.handleShow = this.handleShow.bind(this);
  }

  handleShow() {
    this.setState({ 
      modalState: !this.state.modalState 
    });
  }

  render() {
    return (
      <div>

        <div className={`modal fade ${(this.state.modalState) ? 'show d-block' : 'none'}`} tabIndex="-1" role="dialog">
          <div className="modal-dialog modal-dialog-centered" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title" id="exampleModalLongTitle">Modal title</h5>
                <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                  <span aria-hidden="true">&times;</span>
                </button>
              </div>
              <div class="modal-body">
                ...
              </div>
              <div class="modal-footer">
                <button type="button" class="btn btn-secondary" data-dismiss="modal">Close</button>
                <button type="button" class="btn btn-primary">Save changes</button>
              </div>
            </div>
          </div>
        </div>

        <div className="bg-dark split left">
          <div>
            <Procedure startTime={this.startTime}></Procedure>
          </div>
        </div>

        <div className="bg-light split right">
          <div>
            <Questions startTime={this.startTime}></Questions>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
